import React from 'react';
import { Link } from 'react-router-dom';

import './SearchOption.css';

function SearchOption({ title, icon, value }) {
    return (
        <div className="searchOption">
            {icon && icon}
            <Link to={value}>{title}</Link>
        </div>
    )
}

export default SearchOption;
